import "./css/Reset.css";
import "./css/App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Header from './components/Header.js';
import PlayPage from './components/pages/PlayPage.js';
import Menu2 from "./components/Menu2.js";

import React from 'react';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import BottomNavigation from '@mui/material/BottomNavigation';
import BottomNavigationAction from '@mui/material/BottomNavigationAction';
import FavoriteIcon from '@mui/icons-material/Favorite';
import ArchiveIcon from '@mui/icons-material/Archive';
import Paper from '@mui/material/Paper';

function App() {

  const [value, setValue] = React.useState(0);
  const ref = React.useRef(null);

  return (
    <div className="App">
      <Header />
      <PlayPage />
      <Box sx={{ pb: 7 }} ref={ref}>
        <CssBaseline />
            <Paper sx={{ position: 'fixed', bottom: 0, left: 0, right: 0 }} elevation={3}>
                <BottomNavigation
                    showLabels
                    value={value}
                    onChange={(event, newValue) => {
                        setValue(newValue);
                    }}
                >
                    <BottomNavigationAction label="PROFILE" onClick={showProfilePage} />
                    <BottomNavigationAction label="PLAY" icon={<FavoriteIcon />} />
                    <BottomNavigationAction label="SETTINGS" icon={<ArchiveIcon />} />         
                </BottomNavigation>
            </Paper>
        </Box>
    </div>
  );
}

export default App;
